import React, { Component } from 'react';
import './App.css';
import Register from './Register'

class App extends Component {
  constructor(){
    super();
    this.state ={
      municipalities:[],
      barrios:[]
    }
  }
  componentDidMount(){
    this.getMunicipalities();
  }
  getMunicipalities = async()=>{
    try{
      const response = await fetch('http://localhost:8000/api/v1/auth/municipalities')
      if(response.status !== 200){
          throw Error(response.statusText);
      }
      const municipalitiesParsed = await response.json();
      const data = municipalitiesParsed.data
      const municipalityList= []
      data.forEach((element,i)=>{
        municipalityList.push(element.municipality);
            })
      const municipality = [...new Set(municipalityList)]
      this.setState({
        municipalities: municipality
      })

    }catch(err){
      console.log(err);
    }
  }
  render(){
    console.log(process.env)
    console.log(this.state.municipalities);
    return (
      <div className="App">
        <h1>YUCAJU-App</h1>
        <Register municipalities={this.state.municipalities}/>
      </div>
    );
  }
}

export default App;
